const GoNotesButton = () => {

    const goNotes = () => {
        window.open(process.env.HOSTNAME + '/tree/notes', "_self")
    }

    return (
        <>
        <input type='button' value='Notes' onClick={goNotes}/>
        </>
    )
}

export default GoNotesButton
